import axios from "axios";

export function getProducts(identifier, setProducts) {
  axios
    .post("/products", identifier)
    .then((res) => setProducts(res.data))
    .catch((err) => console.log(err));
}

export function getProduct(identifier, setProduct) {
  axios
    .post("/product", identifier)
    .then((res) => setProduct(res.data[0]))
    .catch((err) => console.log(err));
}

export function postCart(identifier, setCart) {
  axios
    .post("/cart/create", identifier)
    .then((res) => setCart(res.data[0]))
    .catch((err) => console.log(err));
}

export function postUser(identifier, setUser) {
  axios
    .post("/user/create", identifier)
    .then((res) => setUser(res.data[0]))
    .catch((err) => console.log(err));
}

export function postShipping(identifier, setShipping) {
  axios
    .post("/shipping/create", identifier)
    .then((res) => setShipping(res.data[0]))
    .catch((err) => console.log(err));
}

export function postPayment(identifier, setPayment) {
  axios
    .post("/payment/create", identifier)
    .then((res) => setPayment(res.data[0]))
    .catch((err) => console.log(err));
}
